
public class BooleanValueOf {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Boolean valueOfNull = Boolean.valueOf(null);
		Boolean valueOfTrue = Boolean.valueOf("true");
		Boolean valueOfFalse = Boolean.valueOf("false");
		System.out.println("valueOfNull " + valueOfNull);
	}

}
